var config = require('./dbconfig.js');
const sql = require('mssql');
let bcrypt = require('bcrypt');


async function resetdb() {
    try {
        let wipeTables = await deleteTables();
        if (wipeTables == null) {
            return null;
        } else {
            let userTables = await addUserRelatedTables();
            if(userTables == null){
                return null;
            } else {
                let projectTables = await addProjectRelatedTables();
                return projectTables;
            }
        }
    } catch (err) {
        console.log(err)
        return null;
    }
}

async function deleteTables() {
    try {
        let pool = await sql.connect(config)
        let users = await pool.request().query("DROP TABLE users")
        let userDets = await pool.request().query("DROP TABLE userDetails")
        let userPics = await pool.request().query("DROP TABLE userPics")
        let projects = await pool.request().query("DROP TABLE projects")
        let userProjects = await pool.request().query("DROP TABLE userProjects")
        let projectPics = await pool.request().query("DROP TABLE projectPics")
        let projectSkills = await pool.request().query("DROP TABLE projectSkills")
        if (users == null || userDets == null || userPics == null || projects == null || userProjects == null || projectPics == null || projectSkills == null) {
            return null;
        } else {
            return projectSkills;
        }
    } catch (err) {
        console.log(err)
        return null;
    }
}

async function addUserRelatedTables() {
    try {
        let usersTable = await addUsersTable();
        let userDetTable = await addUserDetailsTable();
        //let userSkillsTable = await addUserSkillsTable();
        let userPicsTable = await addUserPicsTable();
        if (usersTable == null || userDetTable == null || userPicsTable == null) {
            return null;
        } else {
            return 1;
        }
    } catch (err) {
        console.log(err);
        return null;
    }
}

//creates the USERS table and adds the admin account
async function addUsersTable() {
    try {
        const table = new sql.Table('users')
        table.create = true
        table.columns.add('id', sql.Int, {nullable: false, primary: true})
        table.columns.add('email', sql.NVarChar(50), {nullable: false})
        table.columns.add('username', sql.NVarChar(20), {nullable:false})
        table.columns.add('password', sql.NVarChar(100), {nullable:false})
        table.columns.add('firstName', sql.NVarChar(20), {nullable: false})
        table.columns.add('lastName', sql.NVarChar(30), {nullable: false})

        let salt = await bcrypt.genSalt(10)
        let adminPass = await bcrypt.hash('adminpass', salt)

        let salt2 = await bcrypt.genSalt(10)
        let elisePass = await bcrypt.hash('elisepass', salt2)

        let salt3 = await bcrypt.genSalt(10)
        let taylorPass = await bcrypt.hash('taylorpass', salt3)

        let salt4 = await bcrypt.genSalt(10)
        let mohamedPass = await bcrypt.hash('mohamedpass', salt4)

        let salt5 = await bcrypt.genSalt(10)
        let sijanPass = await bcrypt.hash('sijanpass', salt5)

        table.rows.add(1, 'admin@gmail.com', 'admin', adminPass, 'Admin', 'Account')
        table.rows.add(2, 'elise@gmail.com', 'elise', elisePass, 'Elise', 'Hlady')
        table.rows.add(3, 'taylor@gmail.com', 'taylor', taylorPass, 'Taylor', 'Mcouat')
        table.rows.add(4, 'mohamed@gmail.com', 'mohamed', mohamedPass, 'Mohamed', 'Elhadary')
        table.rows.add(5, 'sijan@gmail.com', 'sijan', sijanPass, 'Sijan', 'Poudel')

        let pool = await sql.connect(config)
        let createTable = await pool.request().bulk(table, (err, result) => {
            console.log('users created')
        });
        return createTable;
    }
    catch(err) {
        console.log(err);
        return null;
    }
}


